import {Input,Table,Spacer,Button} from "@nextui-org/react";
import React from "react";
export default function ModalTipoDeDatos() {
const [valores, setValores] = React.useState([]);
function updateValueMedia() {
  const e = document.getElementById('AddValores').value
  setValores(oldArray => [...oldArray, e])
}
  return (
    <div css={{
      Width: "100%",
    }}>
      <div css={{
      Width: "100%",
      displat:"flex"
    }}>
      <Input label="Agregar Dato" placeholder="Ej: 9" type="number" size="lg" id="AddValores" />
      <Button shadow color="success" auto onPress={updateValueMedia}>
                        Agregar Valores
                    </Button>
                    </div>
      <Spacer y={2} />
      <Table
      aria-label="Example table with static content"
      css={{
        height: "auto",
        Width: "100%",
      }}
    >
      <Table.Header>
        <Table.Column>Xi</Table.Column>
        <Table.Column>Xi2</Table.Column>
      </Table.Header>
      <Table.Body>
        {
          valores.map((item, index) => (
          <Table.Row key={index}>
          <Table.Cell>{item}</Table.Cell>
          <Table.Cell>{Math.pow(item, 2)}</Table.Cell>
        </Table.Row>
        ))}
      </Table.Body>
    </Table>
    </div>
  );
}
